;; **
;;; # Simple Image Rotations
;;; 
;;; > In this recipe we learn how to create a 2x2 image of all the possible simple rotation of an image using the OpenCv rotate function.
;; **

;; @@
(ns opencv4.rotations-collage
  (:require
    [opencv4.utils :as u]
    [opencv4.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; To make the image usable for rotations, we start by writing a function turning the image into a square version, cropping at the proper places. 
;; **

;; @@
(defn center-crop[img dest]
  (let[
    w (cols img)
    h (rows img)
    s (clojure.core/min w h)
    rect (new-rect
      (- (/ w 2) (/ s 2))
      (- (/ h 2) (/ s 2))
      s
      s)]
    (-> img
        (submat rect)
        (copy-to dest)
        )))

(defn center-crop![src]
  (center-crop src src)
  src)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;opencv4.rotations-collage/center-crop!</span>","value":"#'opencv4.rotations-collage/center-crop!"}
