(-> 
  "resources/images/cat.jpg" 
  (imread)
  (u/resize-by 0.15)
  (u/mat-view))

(-> 
  "resources/images/cat.jpg" 
  (imread)
  (center-crop!)
  (u/resize-by 0.15)
  (u/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"180\" height=\"180\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x77508da0 \"BufferedImage@77508da0: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 180 height = 180 #numDataElements 3 dataOff[0] = 2\"]"}
